import { useState } from "react";

const Form = () => {
  const [datos, setDatos] = useState({
    nombre: "",
    apellido: "",
  });

  const handleInputChange = (event) => {
    // console.log(event.target.value);
    setDatos({
      ...datos,
      [event.target.name]: event.target.value,
    });
  };

  const enviarDatos = (event) => {
    event.preventDefault();
    console.log(datos.nombre + " " + datos.apellido);
  };
  return (
    <div className="container p-5 div_formulario">
      <div>
        <h1>FORMULAIRE DE CONTACT</h1>
        <form className="row form" onSubmit={enviarDatos}>
          <div className="col-lg-12">
            <label for="nombre">Votre nom</label>
            <input
              type="text"
              className="form-control"
              name="nombre"
              onChange={handleInputChange}
            />
          </div>
          <div className="col-lg-12">
            <label for="nombre">Votre apell</label>
            <input
              type="text"
              className="form-control"
              name="apellido"
              onChange={handleInputChange}
            />
          </div>
          <div className="col-lg-12">
            <label for="nombre">Email</label>
            <br />
            <input type="email" name="email" className="col-lg-12"></input>
          </div>
          {/* Prueba checkbox */}
          <div className="col-lg-12">
            <label for="nombre">Intéressé par</label>
            <br />
            <input className="check" name="wet" type="checkbox" />{" "}
            {" Wet Suits "}
            <input className="check" name="dry" type="checkbox" />{" "}
            {" Dry Suits "}
            <input className="check" name="accesories" type="checkbox" />{" "}
            {" Accesories "}
          </div>
          {/* Button */}
          <div className="col-lg-3">
            <button className="video" type="submit">
              Enviar
            </button>
          </div>
        </form>
        <p>
          {datos.nombre} - {datos.apellido}
        </p>
      </div>
    </div>
  );
};

export default Form;
